import { StyleSheet} from "react-native";

const styles = StyleSheet.create({
    header:{
        width: "100%",
        height: "100%",
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "center"
    },
    headerText:{
        fontWeight: "bold",
        fontSize: 20,
        color: "black",
        letterSpacing: 1
    }

});

export default styles
